INSERT INTO `events` VALUES ('https://static.au.edusercontent.com/files/xyoeZ9ILwbfVmIWDpfCzppZR','Meetup','2022-10-05 10:59:29','2022-10-05 10:59:29','<p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 15px; font-family: Arial;\">This event aims at creating a welcoming environment for women who enjoy Computer Science to share their thoughts, make friends, and seek &amp; offer support. </span></p><p><img src=\"https://static.au.edusercontent.com/files/xyoeZ9ILwbfVmIWDpfCzppZR\" alt=\"\" data-href=\"\" style=\"width: 50%;\"/><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 15px; font-family: Arial;\"><br><br>All women interested in technology across all faculties are welcome to join. </span></p><p><img src=\"https://static.au.edusercontent.com/files/n1H0Oz0YE0J0LCaszBlhxWCD\" alt=\"\" data-href=\"\" style=\"width: 50%;\"/><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 15px; font-family: Arial;\"><br><br>So come and meet like-minded people, learn about the WinCS student group and have some bites before dinner!</span></p>','UoA Women in CS Meetup',4,1665103808),('https://hips.hearstapps.com/hmg-prod/images/es-070518-midtown-vests-1531144531.jpg?crop=1.00xw:1.00xh;0,0&resize=1200:*','','2022-10-05 11:04:09','2022-10-05 11:04:09','<h1>Big Heading</h1><p>paragraph</p><h2>smaller heading</h2><p>paragraph</p><p><img src=\"https://hips.hearstapps.com/hmg-prod/images/es-070518-midtown-vests-1531144531.jpg?crop=1.00xw:1.00xh;0,0&resize=1200:*\" alt=\"\" data-href=\"\" style=\"width: 50%;\"/></p>','The Business School is giving everyone Patagonia vests',5,20221006220347),('https://i0.wp.com/vhin.co.nz/wp-content/uploads/2018/03/UoA-logo-e1521077775215.png?ssl=1','Video','2022-10-05 13:20:50','2022-10-05 13:20:50','<h1>UoA Weekly</h1><div data-w-e-type=\"video\" data-w-e-is-void>\n<iframe width=\"1120\" height=\"630\" src=\"https://www.youtube.com/embed/ncSE2RNHz9U\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture\" allowfullscreen=\"\"></iframe>\n</div><p><br></p>','You can insert videos in events',6,20221005002040);
