INSERT INTO `news` VALUES (8,'F1 powerhouse Mercedes want Daniel Ricciardo as negotiations revealed','<p style=\"text-align: start;\"><img src=\"data:image/jpeg;base64,\" alt=\"riccardo.jpg\" data-href=\"\" style=\"width: 50%;\"></p><p style=\"text-align: start;\">Last month, Ricciardo was linked to Mercedes as a reserve driver — the powerhouse team’s seats for 2023 are set in stone with Lewis Hamilton and George Russell proving a strong and established partnership.</p><p style=\"text-align: start;\">Ricciardo will no doubt bring experience to the role but suggestions he could be positioned to take over from the 37-year-old Lewis Hamilton have raged, despite denials from the man himself as well as Mercedes team principal Toto Wolff.</p><p style=\"text-align: start;\">Wolff revealed Hamilton said he has five more years left in F1.</p><p style=\"text-align: start;\">“We are totally transparent with each other,” Wolff told Channel 4 on the weekend.</p><p style=\"text-align: start;\">“We talk about the future also, and I think it’s very easy. Lewis will be the first one to say ‘I can’t do this anymore because I feel I haven’t got the reactions anymore, or I’ve just lost fun doing it and there is another generation growing up that’s just very strong’.</p><p style=\"text-align: start;\">“So I have no doubt that whatever we agree on a contract extension, which is going to happen, that we both are always going to discuss very openly ‘what does the future hold?’</p><p style=\"text-align: start;\">“The advantage is we speak a lot together, he lives here and I’m there [in Monaco]. And just last week we sat down and he says ‘well, I have another five years in me. How do you see that?’</p><p style=\"text-align: start;\">“I mean, he’s the shining star in Formula 1 on and off track. I think we would lose the greatest personality Formula 1 ever had.”</p><p style=\"text-align: start;\"><img src=\"https://content.api.news/v3/images/bin/da2a359fd6c2f70e93c5d3196a1d0542\" alt=\"\" data-href=\"\" style=\"width: 50%;\"></p>','2022-10-05 11:16:46','2022-10-05 11:16:46','','https://www.formula1.com/content/dam/fom-website/manual/Misc/2022manual/2022Races/Singapore/Sunday/GettyImages-1428947951.jpg.transform/9col-retina/image.jpg'),(9,'Programming competition success for Avcol girls','<h1 style=\"line-height: 1.5;\"><span style=\"background-color: transparent;\">News</span></h1><p style=\"line-height: 1.5;\"><span style=\"background-color: transparent;\">When the call went out from the Mathematics &amp; Statistics Department at the start of the term for any Year 10 girls interested in a beginners\' programming competition, 30 keen students applied. A short logic test and a few tough decisions later, two teams of two were formed: Avondale 1 consisting of Seo-Lin Cho and Feiyang Wu, and Avondale 2 consisting of Demelza Colaco and Waimarie Ned-Senior. Unfortunately, Waimarie had to pull out shortly before the competition date, and Amanda Ruddell was able to step in, working extremely hard to catch up on her understanding of programming in Python.</span></p><p style=\"line-height: 1.5;\"><br></p><p style=\"line-height: 1.5;\"><span style=\"background-color: transparent;\">The girls put in tremendous number of hours preparing for the competition, alongside their studying for exams. The shutdown of the University of Auckland due to the Covid-19 case in the city meant that at the last minute, the event was run instead at Avondale College on the Tuesday, where the teams synched up with 53 other secondary school teams based at Auckland schools and universities around the country. The four girls spent Tuesday morning fine-tuning their programming skills before the two hour competition in the afternoon. Midway, Avondale 1 was placed 6th and Avondale 2 was placed 9th. The girls then had an amazing second hour to pull off a 2nd and 3rd place finish respectively!</span></p><p style=\"line-height: 1.5;\"><br></p><p style=\"line-height: 1.5;\"><span style=\"background-color: transparent;\">The Mathematics Department commends the hard work and endeavour of Seo-Lin, Feiyang, Demelza and Amanda - and especially congratulates Seo-Lin and Feiyang on being one of only two teams to complete the final question successfully. Finally, a huge thank you to Mr J Clark and Ms G Augustin for giving up multiple lunch times and free periods to help teach the girls their programming skills.</span></p><p style=\"line-height: 1.5;\"><br></p><p style=\"line-height: 1.5;\"><span style=\"background-color: transparent;\">- Mr P Boardman, Mathematics Department</span></p><p style=\"line-height: 1.5;\"><img src=\"https://static.wixstatic.com/media/bef2e6_4f5a46792dc84faea3d746292f9cdc29~mv2.jpeg/v1/fill/w_860,h_647,al_c,q_85,enc_auto/bef2e6_4f5a46792dc84faea3d746292f9cdc29~mv2.jpeg\" alt=\"\" data-href=\"\" style=\"width: 740px;height: 557px;\"></p><p style=\"line-height: 1.5;\"><br></p><p style=\"line-height: 1.5;\"><span style=\"background-color: transparent;\">Avcol programmers: Seo-Lin Cho, Demelza Colaco and Amanda Ruddell. (Not pictured: Feiyang Wu)</span></p><p style=\"line-height: 1.5;\"><span style=\"background-color: transparent;\"><br></span></p>','2022-10-05 11:21:36','2022-10-05 11:21:36','','https://static.wixstatic.com/media/bef2e6_4f5a46792dc84faea3d746292f9cdc29~mv2.jpeg/v1/fill/w_860,h_647,al_c,q_85,enc_auto/bef2e6_4f5a46792dc84faea3d746292f9cdc29~mv2.jpeg'),(12,'test1','','2022-10-05 14:55:12','2022-10-05 14:55:12','','');
