INSERT INTO `phds` VALUES (1,'Katharina Dost','PhD Student','<p><strong>Bio:</strong></p><p>Since July 2019, I am a PhD student in the School of<br>Computer Science. Before, I was a Data Scientist in marketing, where my work<br>centered around predictive models and clustering techniques. I did my<br>undergraduate studies in Mathematics and my Master’s degree in Scientific<br>Computer Science at the University of Mainz, Germany. My main research<br>interests revolve around Machine Learning and Data Mining, particularly<br>concerning biases in datasets.</p><p><strong>Research topic:</strong></p><p>In my PhD, I investigate different models to identify<br>selection biases in databases, assuming no ground truth information on the data<br>is available. That is, we have no information on what the dataset would look<br>like if it was not biased and hence cannot quantify a potential bias directly.<br>Although largely overlooked by the current literature, we can assume that<br>unknown biases are prevalent in most datasets and silently compromise the<br>training of Machine Learning models. My research is a first step toward<br>automated detection of those biases.</p>','/Katharina.png'),(2,'test delete','PhD Student','<p>intro for the student</p>','/avatar.png');
