INSERT INTO `projects` VALUES (1,' Gaze input for human computer interaction by Asma Shakil','<p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 15px;\">The potential of gaze input for human computer interaction. An important goal of human-computer interaction research is to build appealing and intuitive user interfaces. </span></p><p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 15px;\">Gaze-based interaction is an emerging technology that uses eye movements to interact with a computer. Eye movements have the advantage of being fast and natural when compared to other traditional input devices such as a mouse or keyboard. Gaze-based interaction has been used in the past in areas of accessibility where people cannot use their hands due to physical impairments or disabilities. However, it has the potential to become ubiquitous. Possibly in the near future, many popular devices such as smartphones and virtual reality headsets will have built-in gaze tracking abilities and many other device designs which have user-facing cameras may provide integrated gaze tracking. </span></p><p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 15px;\">In my research, I am looking at utilizing gaze input to improve the interaction experience for standard users in everyday tasks. Using source code navigation as a case study for everyday tasks, I have developed CodeGazer which is a tool that lets users browse code using just their eyes. An evaluation of the tool showed that it is comparable to keyboard in terms of speed (although slower than mouse), is accurate and has good usability. During our user study most developers chose to use gaze input as a means of navigating code when given the choice between a keyboard, mouse or gaze. This shows that users will accept gaze for everyday tasks if it delivers clear advantages over the mouse.</span></p>',''),(2,'Adaptive Predictive System for Life-long Learning on Data Streams by Yun Sing Koh','<p><span style=\"color: rgb(80, 80, 80); background-color: rgb(255, 255, 255); font-size: 15px;\">PhD Student: Ben Halstead </span></p><p><span style=\"color: rgb(80, 80, 80); background-color: rgb(255, 255, 255); font-size: 15px;\">Pollution from wood burners has serious health implications for residents of rural towns, even in developed countries. Monitoring the level of airborne particulate matter, PM2.5, in these areas often requires making inferences about missing or corrupted readings. Air Quality inference in these cases poses two key challenges. Firstly, air quality displays non-linear spatio-temporal relationships dependent on many factors. Secondly, these factors can evolve over time, changing the distribution of data. For example, changing wind directions can have a large impact on which neighbouring sensors are most relevant to inference. Methods incorporating environmental factors to capture these changes, e.g. weather, traffic and points of interest, have found success in urban environments. However, many locations only have access to a few if any of these features, thus, inference methods must employ alternate approaches to detect and adapt to changes. We propose a data stream based system, called AirStream, to infer missing PM2.5 levels that is able to detect and adapt to changes in unknown features. Such changes in the distribution of data are known as concept drift. By treating the data set as a stream and learning incrementally, AirStream can use current concept drift detection methods to detect concept drift. We adapt to concept drift by selecting a new classifier suitable for the emerging conditions. In reality, this detection and adaption process may be affected by noise, causing errors in these classifier transitions. We propose a repairing algorithm to identify and correct these errors. We deployed our approach on two air quality studies in New Zealand rural towns, and also tested it on a Beijing benchmark data set. We found gains in inference performance comparing AirStream against seven baseline methods. We further investigate the relationship between the changes we detected and changes in underlying weather conditions. We discovered a strong predictive link between the state of our system and current meteorological conditions. This project is part of Royal Society Marsden Fast-Start. Supervisors: Assoc Prof Yun Sing Koh, Dr Pat Riddle, Prof Mykola Pechenizkiy (TU/e Eindohoven), Prof Albert Bifet (Waikato).</span></p>','');
