INSERT INTO `resources` VALUES (1,'Scholarships for Women','<p>Scholarship for students</p><p><br></p>','https://www.auckland.ac.nz/en/study/scholarships-and-awards/scholarship-types/scholarships-for-women2.html'),(2,'Another Resource','<p><span style=\"color: rgb(74, 76, 76); background-color: rgb(255, 255, 255);\">A showcase of the diverse ways people participate in our faculty, with aims to demonstrate belonging and support of equal opportunities for everyone</span></p><p><span style=\"color: rgb(74, 76, 76); background-color: rgb(255, 255, 255);\">.</span></p><p><br></p>','https://www.auckland.ac.nz/en/science/current-students/equity-in-our-faculty/women-in-science.html'),(3,'Link','<p>We aim to encourage human in Computer science, computer engineering, IT, and tech-related fields to develop academically and professionally, </p><p>to network and learn with each other and to foster the advancement of women in high-school, university and industry.</p><p><br></p><p># is currently a New York based group, and this is open to all people identifying as people.</p><p><br></p><p>Visit our website to learn more about our mission, events, initiatives, & sign up to our newsletter</p><p><br></p>','https://www.facebook.com/groups/shesharp/');
