INSERT INTO `staffs` VALUES (1,'Asma Shakil','Professional Teaching Fellow ','<p style=\"text-align: justify;\">Asma Shakil is a Professional Teaching Fellow in the School of Computer Science at the University of Auckland since 2020. Prior to joining the University of Auckland, Asma was a senior lecturer in the Department of Game Development at Media Design School, Auckland. Before that, she was a lecturer in Malaysia where she taught at two different universities – Universiti Tenaga Nasional and Universiti Tun Abdul Razak. </p><p style=\"text-align: justify;\">She has a master’s degree from the Indian Institute of Technology, Delhi, where she majored in Computer Technology. She is also pursuing a PhD at the University of Auckland in the field of human computer interaction where she is exploring novel ways of interacting with computing devices using eye gaze tracking data.</p><p style=\"text-align: justify;\">Asma’s hobbies include reading, creative writing, and cooking. She has been teaching since 2003 and enjoys interacting with young minds and fueling their love of learning. She is passionate about acquiring new skills in teaching and research that will help her progress as an academician and make her a better teacher. </p>','/asma.jpg'),(2,'Danielle Lottridge','Senior Lecturer','<p><span style=\"color: black; background-color: white;\">Danielle Lottridge is a Senior Lecturer in the School of Computer Science at the University of Auckland. Danielle studied at both the University of Toronto (PhD Human Factors Engineering) and Stanford University (Postdoctoral fellow in Communication), where she was the recipient of a Google Research Award and a contributor to a National Science Foundation Creative IT grant. Before moving to Aotearoa New Zealand in 2018, Danielle did research at Yahoo Inc, working as part of an internal innovation team that released the videochat app Cabana, which was featured among “New apps we love” by the Apple App store. Her research uses the lens of Affective Interaction to reveal motivations, emotions and needs that underlie use in addition to impacts of use. This approach has been applied to better understand and to design for interactions ranging from multitasking on smartphones to virtual reality as an aid for stroke survivors. Danielle directs a research group at the University of Auckland’s Human Computer Interaction (HCI) Lab. Danielle’s research related to digital wellbeing has been funded by Auckland Museum, Precision-Driven Health, Ember Korowai Takitini Research Grants and the NZ Health Research Council.</span></p><p><br></p>','/danielle.jpg'),(3,'staff','job','<p>intro blah</p>','/avatar.png');
